import React from 'react';
import '../assets/styles/App.css';

const Home = () => {
  return (
    <>
      <div>hello Home</div>
      <div className="atom">
        <div className="orbit1">
          <div className="electron1" style={{ top: "0", left: "50%" }}></div>
        </div>
        <div className="orbit2">
          <div className="electron2" style={{ top: "50%", left: "0" }}></div>
        </div>
        <div className="orbit3">
          <div className="electron3" style={{ bottom: "-2%", left: "50%" }}></div>
        </div>
      </div>
    </>
  );
};

export default Home;
